import React, { useState } from 'react';
import './ProductPages.css';

const FramedNotes = ({ addToCart }) => {
  const [selectedSizes, setSelectedSizes] = useState({});

  const framedNotes = [
    {
      id: 1,
      name: 'Classic Wooden Frame',
      description: 'Beautiful wooden frame with currency note',
      sizes: [
        { size: 'Small (6x8 inch)', price: 299 },
        { size: 'Large (8x10 inch)', price: 399 }
      ]
    },
    {
      id: 2,
      name: 'Premium Gold Frame',
      description: 'Elegant gold-finished frame with currency note',
      sizes: [
        { size: 'Small (6x8 inch)', price: 399 },
        { size: 'Large (8x10 inch)', price: 499 }
      ]
    },
    {
      id: 3,
      name: 'Modern Silver Frame',
      description: 'Contemporary silver frame with currency note',
      sizes: [
        { size: 'Small (6x8 inch)', price: 349 },
        { size: 'Large (8x10 inch)', price: 449 }
      ]
    },
    {
      id: 4,
      name: 'Vintage Antique Frame',
      description: 'Vintage-style antique frame with currency note',
      sizes: [
        { size: 'Small (6x8 inch)', price: 449 },
        { size: 'Large (8x10 inch)', price: 549 }
      ]
    }
  ];

  const handleSizeSelect = (frameId, sizeIndex) => {
    setSelectedSizes({
      ...selectedSizes,
      [frameId]: sizeIndex
    });
  };

  const handleAddToCart = (frame) => {
    const selectedSizeIndex = selectedSizes[frame.id] || 0;
    const selectedSize = frame.sizes[selectedSizeIndex];

    addToCart({
      name: `${frame.name} - ${selectedSize.size}`,
      price: selectedSize.price,
      description: frame.description,
      category: 'Framed Notes'
    });
    alert(`${frame.name} added to cart!`);
  };

  return (
    <div className="product-page">
      <div className="container">
        <div className="page-header">
          <h1 className="page-title">Framed Notes</h1>
          <p className="page-subtitle">
            Beautiful frames showcasing currency notes with special serial numbers, perfect for home or office display
          </p>
        </div>

        <div className="products-grid">
          {framedNotes.map((frame) => {
            const selectedSizeIndex = selectedSizes[frame.id] || 0;
            const selectedSize = frame.sizes[selectedSizeIndex];

            return (
              <div key={frame.id} className="product-card">
                <div className="product-image">
                  <div className="frame-display">🖼️</div>
                </div>

                <div className="product-info">
                  <h3 className="product-name">{frame.name}</h3>
                  <p className="product-description">{frame.description}</p>

                  <div className="size-options">
                    {frame.sizes.map((size, index) => (
                      <button
                        key={index}
                        onClick={() => handleSizeSelect(frame.id, index)}
                        className={`size-option ${selectedSizeIndex === index ? 'selected' : ''}`}
                      >
                        {size.size}
                      </button>
                    ))}
                  </div>

                  <div className="product-price">₹{selectedSize.price}</div>

                  <button 
                    onClick={() => handleAddToCart(frame)}
                    className="btn btn-primary add-to-cart-btn"
                  >
                    Add to Cart
                  </button>
                </div>
              </div>
            );
          })}
        </div>

        <div className="product-info-section">
          <h2>About Our Framed Notes</h2>
          <div className="info-grid">
            <div className="info-item">
              <h3>🎨 Premium Frames</h3>
              <p>High-quality frames made from durable materials with elegant finishes.</p>
            </div>
            <div className="info-item">
              <h3>💎 Special Notes</h3>
              <p>Each frame includes a carefully selected currency note with meaningful serial numbers.</p>
            </div>
            <div className="info-item">
              <h3>🏠 Perfect Display</h3>
              <p>Ideal for home, office, or as a unique gift that tells a story.</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default FramedNotes;
